import React from "react";
import "./App.css";

const LogoSlider = () => {
  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>üçï Pizza & üçî Burger Logo Slider</h2>
      <div style={styles.slider}>
        <div style={{ ...styles.logo, ...styles.pizza }}>üçï</div>
        <div style={{ ...styles.logo, ...styles.burger }}>üçî</div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    textAlign: "center",
    padding: "20px",
    background: "linear-gradient(135deg, #ffdde1, #ee9ca7)",
    borderRadius: "10px",
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.2)",
    maxWidth: "400px",
    margin: "auto",
  },
  heading: {
    color: "#ff77aa",
    fontFamily: "'Poppins', sans-serif",
    marginBottom: "15px",
  },
  slider: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    animation: "slide 4s linear infinite",
  },
  logo: {
    fontSize: "50px",
    color: "#ff69b4",
    width: "80px",
    height: "80px",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    borderRadius: "50%",
    transition: "transform 0.5s ease, background 0.5s ease",
    cursor: "pointer",
  },
  pizza: {
    backgroundColor: "#fcd7e7",
  },
  burger: {
    backgroundColor: "#ffb3c6",
  },
};

// Animation Styling (Add this in App.css or a <style> tag)
const stylesCSS = `
@keyframes slide {
  0% { transform: translateX(-10px); }
  50% { transform: translateX(10px); }
  100% { transform: translateX(-10px); }
}
`;

export default function App() {
  return (
    <div>
      {/* Add styles dynamically */}
      <style>{stylesCSS}</style>
      <LogoSlider />
    </div>
  );
}
